measurements.description:
Three well presented flowers on a 46-cm erect inflorescence; dorsal sepal vibrant chartreuse,
	heavily striped dark mahogany; synsepal vibrant chartreuse, mahogany stripes;
	petals symetrically twisted, light green, spotted and barred mahogany basally, coalesced into solid mahogany distally,
	proximal margins ruffled, sparsely hirsute; pouch light green overlaid mahogany except distal tip; 
	staminode light green-yellow, mahogany cilia edges; 
	substance firm; texture matte, pouch glossy.
